import axios from 'axios';
/*
*
* NEED TO REWORK
* 
* Add request to back end.
*/

export const authenticateUser = async (session_id) => {

    if(session_id=="session_id_template"){

        return axios.get("./templates/userLoginSuccess.json") //template request
        .then(r => r.json())
        .then(data => {
            return data
        })
        .catch(error => {
            alert(error.message)
        });
    }
    else{
        return axios.get("./templates/userLoginFail.json") //template request
        .then(r => r.json())
        .then(data => {
            return data
        })
        .catch(error => {
            alert(error.message)
        });
    }

}
